import { useState } from "react";
import styles from "./addItem.module.scss";
import classNames from "classnames/bind";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlus, faImage } from "@fortawesome/free-solid-svg-icons";

const cx = classNames.bind(styles);

function AddItems({ apiUrl }) {
    const [itemName, setItemName] = useState(""); // Tên sản phẩm
    const [price, setPrice] = useState(""); // Giá sản phẩm
    const [images, setImages] = useState([]); // Mảng file ảnh
    const [imagePreviews, setImagePreviews] = useState([]); // Mảng ảnh xem trước
    const [message, setMessage] = useState(""); // Thông báo
    const [openModal, setOpenModal] = useState(false); // Trạng thái mở modal

    // Mở modal
    const handleOpenModal = () => setOpenModal(true);

    // Đóng modal
    const handleCloseModal = () => {
        setOpenModal(false);
        setMessage("");
        setImages([]);
        setImagePreviews([]);
    };

    // Xử lý chọn nhiều ảnh
    const handleImageChange = (e) => {
        const files = Array.from(e.target.files); // Lấy danh sách file

        if (files.length > 0) {
            setImages(files);

            // Tạo ảnh xem trước
            const previews = files.map((file) => {
                return URL.createObjectURL(file);
            });

            setImagePreviews(previews);
        }
    };

    // Gửi dữ liệu lên API
    const handleAddItem = async () => {
        if (!itemName || !price || images.length === 0) {
            setMessage("Vui lòng nhập đầy đủ thông tin.");
            return;
        }

        const formData = new FormData();
        formData.append("itemName", itemName);
        formData.append("price", price);
        images.forEach((image) => formData.append("images", image)); // Gửi nhiều ảnh

        try {
            const response = await fetch(apiUrl, {
                method: "POST",
                body: formData,
            });

            const data = await response.json();
            if (data.success) {
                setMessage("Thêm sản phẩm thành công!");
                setItemName("");
                setPrice("");
                setImages([]);
                setImagePreviews([]);
                setOpenModal(false);
            } else {
                setMessage("Thêm sản phẩm thất bại!");
            }
        } catch (error) {
            console.error("Lỗi:", error);
            setMessage("Có lỗi xảy ra!");
        }
    };

    return (
        <div className={cx("wrapper")}>
            {/* Nút mở modal */}
            <button className={cx("btn-openModal")} onClick={handleOpenModal}>
                <FontAwesomeIcon icon={faPlus} /> Thêm sản phẩm
            </button>

            {/* Form thêm sản phẩm */}
            {openModal && (
                <div className={cx("modal")}>
                    <h3>Thêm sản phẩm</h3>

                    {/* Input nhập tên sản phẩm */}
                    <input
                        type="text"
                        placeholder="Tên sản phẩm"
                        value={itemName}
                        onChange={(e) => setItemName(e.target.value)}
                    />

                    {/* Input nhập giá sản phẩm */}
                    <input
                        type="number"
                        placeholder="Giá sản phẩm"
                        value={price}
                        onChange={(e) => setPrice(e.target.value)}
                    />

                    {/* Nút chọn nhiều ảnh */}
                    <label className={cx("btn-upload")}>
                        <FontAwesomeIcon icon={faImage} /> Chọn ảnh
                        <input type="file" accept="image/*" multiple onChange={handleImageChange} hidden />
                    </label>

                    {/* Hiển thị nhiều ảnh xem trước */}
                    <div className={cx("preview-container")}>
                        {imagePreviews.map((preview, index) => (
                            <img key={index} src={preview} alt={`Xem trước ${index}`} className={cx("image-preview")} />
                        ))}
                    </div>

                    {/* Nút thêm sản phẩm */}
                    <button className={cx("btn-submit")} onClick={handleAddItem}>
                        Thêm sản phẩm
                    </button>

                    {/* Nút đóng */}
                    <button className={cx("btn-close")} onClick={handleCloseModal}>
                        Đóng
                    </button>

                    {/* Hiển thị thông báo */}
                    {message && <p>{message}</p>}
                </div>
            )}
        </div>
    );
}

export default AddItems;
